// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

interface Whitelist {
    function addUser(address _addressToWhitelist) external;

    function removeUser(address _addressToWhitelist) external;

    function whitelistCount() external view returns (uint256);

    function close() external;
}

contract PublicWhitelist is Ownable, Whitelist {
    using Counters for Counters.Counter;

    Counters.Counter private _whiteListCounter;

    mapping(address => bool) public whitelistedAddresses;

    modifier isWhitelisted(address _address) {
        require(
            whitelistedAddresses[_address],
            "Whitelist: You need to be whitelisted"
        );
        _;
    }

    function addUser(address _addressToWhitelist) public onlyOwner {
        whitelistedAddresses[_addressToWhitelist] = true;
        _whiteListCounter.increment();
    }

    function removeUser(address _addressToWhitelist) public onlyOwner {
        whitelistedAddresses[_addressToWhitelist] = false;
        /* Si on ajoute ce test le cot en gas passe  60000
        if (whitelistCount() > 0) */
        _whiteListCounter.decrement();
    }

    function whitelistCount() public view returns (uint256) {
        return _whiteListCounter.current();
    }

    function close() public onlyOwner {
        selfdestruct(payable(owner()));
    }

    function exampleFunction()
        public
        view
        isWhitelisted(msg.sender)
        returns (bool)
    {
        return (true);
    }
}

contract AuthorisedWhitelist is PublicWhitelist {
    using Counters for Counters.Counter;

    Counters.Counter private _whiteListCounter;

    mapping(address => bool) private compliantAddresses;

    modifier isAuthorised(address _address) {
        require(
            whitelistedAddresses[_address],
            "Whitelist: You need to be whitelisted"
        );
        _;
    }

    function addCertificate(address _addressToWhitelist) public onlyOwner {
        compliantAddresses[_addressToWhitelist] = true;
        whitelistedAddresses[_addressToWhitelist] = true;
        _whiteListCounter.increment();
    }

    function removeCertificate(address _addressToWhitelist) public onlyOwner {
        compliantAddresses[_addressToWhitelist] = false;
        whitelistedAddresses[_addressToWhitelist] = false;
        /* Si on ajoute ce test le cot en gas passe  60000
        if (whitelistCount() > 0) */
        _whiteListCounter.decrement();
    }

    function checkUser(address _address)
        public
        view
        isAuthorised(msg.sender)
        returns (bool)
    {
        return compliantAddresses[_address];
    }
}

contract Holder is PublicWhitelist {
    function getBalance() public view returns (uint256) {
        return address(this).balance;
    }

    function withdraw() public onlyOwner {
        address payable owner_address;
        owner_address = payable(owner());
        owner_address.transfer(address(this).balance);
    }
}
